            <tspan style="white-space:pre" y="14.4" x="9">存放着在不断扩充着的东西</tspan>
        </text>
    </g>
    <g ed:width="457" ed:height="21" transform="matrix(1,0,0,1,657.95,131.5)" ed:parentid="118" id="120">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">存放邮件、系统日志等变化文件，存放系统或程序运行过程中的数据文件(variable)</tspan>
        </text>
    </g>
    <g ed:width="47" ed:height="21" transform="matrix(1,0,0,1,398.95,159)" ed:parentid="102" id="122">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">/tmp</tspan>
        </text>
    </g>
    <g ed:width="127" ed:height="21" transform="matrix(1,0,0,1,472.95,159)" ed:parentid="122" id="124">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">存放一些临时文件的</tspan>
        </text>
    </g>
    <g ed:width="144" ed:height="21" transform="matrix(1,0,0,1,398.95,214)" ed:parentid="102" id="128">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">在Linux中一切皆文件！</tspan>
        </text>
    </g>
    <g ed:width="104" ed:height="21" transform="matrix(1,0,0,1,406.95,504.25)" ed:parentid="314" id="130">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">深入理解 inode</tspan>
        </text>
    </g>
    <g ed:width="88" ed:height="21" transform="matrix(1,0,0,1,537.95,473.5)" ed:parentid="130" id="132">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">inode是什么</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,537.95,501)" ed:parentid="130" id="136">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">文件储存在硬盘上，硬盘的最小存储单位叫做 "扇区",操作系统读取硬盘的时候一次性连续读</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">取多个扇区，即一次性读取一个"块"（block）,文件数据都储存在 "块" 中</tspan>
        </text>
    </g>
    <g ed:width="282" ed:height="21" transform="matrix(1,0,0,1,652.95,473.5)" ed:parentid="132" id="140">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">inode存储着文件的信息 , 文件创建者,创建日期等</tspan>
        </text>
    </g>
    <g ed:width="141" ed:height="21" transform="matrix(1,0,0,1,961.95,473.5)" ed:parentid="140" id="142">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">中文译名为 "索引节点"</tspan>
        </text>
    </g>
    <g ed:width="307" ed:height="21" transform="matrix(1,0,0,1,537.95,423.75)" ed:parentid="130" id="144">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">硬盘格式化的时候，操作系统自动将硬盘分成两个区域</tspan>
        </text>
    </g>
    <g ed:width="433" ed:height="21" transform="matrix(1,0,0,1,871.95,401.5)" ed:parentid="144" id="146">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">用户数据，即文件数据块 (data block)，数据块是记录文件真实内容的地方； </tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,871.95,429)" ed:parentid="144" id="148">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">元数据则是文件的附加属性，如文件名、文件大小、创建时间、所有者、文件所在的inode等</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">信息。 </tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,537.95,545.5)" ed:parentid="130" id="150">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">每个文件都必须有一个inode,linux根据inode识别不同文件而不是文件名，如果inode已经用</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">光就无法在硬盘上创建新文件。</tspan>
        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,537.95,598.5)" ed:parentid="130" id="158">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">特殊作用</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,631.95,590)" ed:parentid="158" id="160">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">由于 inode 号码与文件名分离，是根据inode来识别文件,而不是文件名, 删除inode才是真正</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">删除文件</tspan>
        </text>
    </g>
    <g ed:width="200.2" ed:height="38" transform="matrix(1,0,0,1,235.75,818.75)" ed:parentid="101" id="170">
        <path stroke-width="3" stroke="#ffffff" fill="#2da2bf" stroke-linejoin="round" d="M9.5,0L200.2,0L190.7,38L0,38L9.5,0z"/>
        <text class="st32">
            <tspan style="white-space:pre" y="23.5" x="21"> 什么是硬链接与软链接</tspan>
        </text>
    </g>
    <g ed:width="55" ed:height="21" transform="matrix(1,0,0,1,462.95,786)" ed:parentid="170" id="172">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">硬链接</tspan>
        </text>
    </g>
    <g ed:width="271" ed:height="21" transform="matrix(1,0,0,1,544.95,803)" ed:parentid="172" id="176">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">这意味着，可以用不同的文件名访问同样的内容</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,842.95,794.5)" ed:parentid="176" id="178">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">对文件内容进行修改，会影响到所有文件名；但是，删除一个文件名，不影响另一个文件名的</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">访问</tspan>
        </text>
    </g>
    <g ed:width="494" ed:height="21" transform="matrix(1,0,0,1,462.95,661)" ed:parentid="170" id="180">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">inode 信息中有一项叫做 "链接数"，记录指向该 inode 的文件名总数，这时就会增加 1。</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,462.95,688.5)" ed:parentid="170" id="182">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">删除一个文件名，就会使得 inode 节点中的 "链接数" 减1。当这个值减到 0，表明没有文件</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">名指向这个 inode，系统就会回收这个 inode 号码，以及其所对应 block 区域。</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="55" transform="matrix(1,0,0,1,544.95,733)" ed:parentid="172" id="184">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">硬连接不能跨越不同的文件系统，硬连接记录的是目标的 inode；只能指向文件。硬连接与原</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">始文件都删除才意味着文件被删除。硬链接原文件/链接文件公用一个inode号，说明他们是同</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">一个文件</tspan>
        </text>
    </g>
    <g ed:width="55" ed:height="21" transform="matrix(1,0,0,1,462.95,930)" ed:parentid="170" id="186">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">软链接</tspan>
        </text>
    </g>
    <g ed:width="91" ed:height="21" transform="matrix(1,0,0,1,544.95,911)" ed:parentid="186" id="188">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">又称符号链接</tspan>
        </text>
    </g>
    <g ed:width="139" ed:height="21" transform="matrix(1,0,0,1,544.95,938.5)" ed:parentid="186" id="190">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">能跨越不同的文件系统</tspan>
        </text>
    </g>
    <g ed:width="433" ed:height="21" transform="matrix(1,0,0,1,544.95,966)" ed:parentid="186" id="194">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">删除源文件，则软链接无法使用,因为要通过自己的链接文件找到源文件,找不到</tspan>
        </text>
    </g>
    <g ed:width="109" ed:height="21" transform="matrix(1,0,0,1,614.95,839)" ed:parentid="200" id="196">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">ln 源文件 链接名</tspan>
        </text>
    </g>
    <g ed:width="124" ed:height="21" transform="matrix(1,0,0,1,614.95,993.5)" ed:parentid="202" id="198">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">ln -s 源文件 链接名</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,544.95,839)" ed:parentid="172" id="200">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">命令</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,544.95,993.5)" ed:parentid="186" id="202">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">命令</tspan>
        </text>
    </g>
    <g ed:width="144.2" ed:height="38" transform="matrix(1,0,0,1,235.75,1080.25)" ed:parentid="101" id="204">
        <path stroke-width="3" stroke="#ffffff" fill="#ee7c31" stroke-linejoin="round" d="M9.5,0L144.2,0L134.7,38L0,38L9.5,0z"/>
        <text class="st32">
            <tspan style="white-space:pre" y="23.5" x="21">Linux查看命令</tspan>
        </text>
    </g>
    <g ed:width="279" ed:height="21" transform="matrix(1,0,0,1,406.95,1047.5)" ed:parentid="204" id="206">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">top命令可以实时动态地查看系统的整体运行情况</tspan>
        </text>
    </g>
    <g ed:width="51" ed:height="21" transform="matrix(1,0,0,1,398.95,186.5)" ed:parentid="102" id="208">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">/proc</tspan>
        </text>
    </g>
    <g ed:width="247" ed:height="21" transform="matrix(1,0,0,1,476.95,186.5)" ed:parentid="208" id="210">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">系统内存的映射目录，提供内核与进程信息</tspan>
        </text>
    </g>
    <g ed:width="262" ed:height="21" transform="matrix(1,0,0,1,406.95,1075)" ed:parentid="204" id="212">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">free 命令是一个快速查看内存使用情况的方法</tspan>
        </text>
    </g>
    <g ed:width="171.2" ed:height="38" transform="matrix(1,0,0,1,235.75,1184)" ed:parentid="101" id="214">
        <path stroke-width="3" stroke="#ffffff" fill="#ffaf00" stroke-linejoin="round" d="M9.5,0L171.2,0L161.7,38L0,38L9.5,0z"/>
        <text class="st32">
            <tspan style="white-space:pre" y="23.5" x="21"> 定时任务 crontab</tspan>
        </text>
    </g>
    <g ed:width="175" ed:height="21" transform="matrix(1,0,0,1,433.95,1192.5)" ed:parentid="214" id="216">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">用于设置周期性被执行的指令</tspan>
        </text>
    </g>
    <g ed:width="106.2" ed:height="38" transform="matrix(1,0,0,1,235.75,1315.25)" ed:parentid="101" id="218">
        <path stroke-width="3" stroke="#ffffff" fill="#dd7195" stroke-linejoin="round" d="M9.5,0L106.2,0L96.7,38L0,38L9.5,0z"/>
        <text class="st32">
            <tspan style="white-space:pre" y="23.5" x="21">文件权限</tspan>
        </text>
    </g>
    <g ed:width="115" ed:height="21" transform="matrix(1,0,0,1,368.95,1255)" ed:parentid="218" id="220">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9"> chmod 修改权限</tspan>
        </text>
    </g>
    <g ed:width="93" ed:height="21" transform="matrix(1,0,0,1,368.95,1282.5)" ed:parentid="218" id="222">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">r:4，w:2，x:1</tspan>
        </text>
    </g>
    <g ed:width="285" ed:height="21" transform="matrix(1,0,0,1,368.95,1310)" ed:parentid="218" id="224">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">示例：将 .bashrc 文件的权限修改为 -rwxr-xr--。</tspan>
        </text>
    </g>
    <g ed:width="142" ed:height="21" transform="matrix(1,0,0,1,368.95,1365)" ed:parentid="218" id="226">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9"># chmod 754 .bashrc</tspan>
        </text>
    </g>
    <g ed:width="110" ed:height="21" transform="matrix(1,0,0,1,537.95,1365)" ed:parentid="226" id="228">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">变成了 rwxr-xr--</tspan>
        </text>
    </g>
    <g ed:width="119" ed:height="21" transform="matrix(1,0,0,1,488.95,1282.5)" ed:parentid="222" id="232">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">可读  可写  可执行</tspan>
        </text>
    </g>
    <g ed:width="151" ed:height="21" transform="matrix(1,0,0,1,674.95,1337.5)" ed:parentid="228" id="236">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">第一组 文件拥有者是rwx</tspan>
        </text>
    </g>
    <g ed:width="219" ed:height="21" transform="matrix(1,0,0,1,674.95,1365)" ed:parentid="228" id="238">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">第二组跟文件拥有者的同组人员是 r-x</tspan>
        </text>
    </g>
    <g ed:width="234" ed:height="21" transform="matrix(1,0,0,1,674.95,1392.5)" ed:parentid="228" id="240">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">第三组不跟拥有者同组的其他用户是  r--</tspan>
        </text>
    </g>
    <g ed:width="144" ed:height="21" transform="matrix(1,0,0,1,510.95,1255)" ed:parentid="220" id="242">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">修改文件所有者 chown</tspan>
        </text>
    </g>
    <g ed:width="196.2" ed:height="38" transform="matrix(1,0,0,1,235.75,1559.76)" ed:parentid="101" id="244">
        <path stroke-width="3" stroke="#ffffff" fill="#527294" stroke-linejoin="round" d="M9.5,0L196.2,0L186.7,38L0,38L9.5,0z"/>
        <text class="st32">
            <tspan style="white-space:pre" y="23.5" x="21">文件与目录的基本操作</tspan>
        </text>
    </g>
    <g ed:width="53" ed:height="21" transform="matrix(1,0,0,1,458.95,1446.5)" ed:parentid="244" id="246">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">mkdir</tspan>
        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,538.95,1446.5)" ed:parentid="246" id="248">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">创建目录</tspan>
        </text>
    </g>
    <g ed:width="55" ed:height="21" transform="matrix(1,0,0,1,458.95,1474)" ed:parentid="244" id="250">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9"> rmdir</tspan>
        </text>
    </g>
    <g ed:width="151" ed:height="21" transform="matrix(1,0,0,1,540.95,1474)" ed:parentid="250" id="252">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">删除目录，目录必须为空</tspan>
        </text>
    </g>
    <g ed:width="51" ed:height="21" transform="matrix(1,0,0,1,458.95,1501.5)" ed:parentid="244" id="254">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">touch</tspan>
        </text>
    </g>
    <g ed:width="187" ed:height="21" transform="matrix(1,0,0,1,536.95,1501.5)" ed:parentid="254" id="256">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">更新文件时间或者建立新文件。</tspan>
        </text>
    </g>
    <g ed:width="33" ed:height="21" transform="matrix(1,0,0,1,458.95,1554.51)" ed:parentid="244" id="258">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">cp</tspan>
        </text>
    </g>
    <g ed:width="79" ed:height="21" transform="matrix(1,0,0,1,518.95,1554.51)" ed:parentid="258" id="260">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">复制文件。</tspan>
        </text>
    </g>
    <g ed:width="35" ed:height="21" transform="matrix(1,0,0,1,458.95,1621.27)" ed:parentid="244" id="262">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">rm</tspan>
        </text>
    </g>
    <g ed:width="140" ed:height="21" transform="matrix(1,0,0,1,520.95,1607.52)" ed:parentid="262" id="264">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9"># rm [-fir] 文件或目录</tspan>
        </text>
    </g>
    <g ed:width="93" ed:height="21" transform="matrix(1,0,0,1,520.95,1635.02)" ed:parentid="262" id="266">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">-r ：递归删除</tspan>
        </text>
    </g>
    <g ed:width="36" ed:height="21" transform="matrix(1,0,0,1,458.95,1676.27)" ed:parentid="244" id="268">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">mv</tspan>
        </text>
    </g>
    <g ed:width="79" ed:height="21" transform="matrix(1,0,0,1,521.95,1676.27)" ed:parentid="268" id="270">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">移动文件。</tspan>
        </text>
    </g>
    <g ed:width="182" ed:height="21" transform="matrix(1,0,0,1,627.95,1662.52)" ed:parentid="270" id="272">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9"> mv [-fiu] source destination</tspan>
        </text>
    </g>
    <g ed:width="394" ed:height="21" transform="matrix(1,0,0,1,627.95,1690.02)" ed:parentid="270" id="274">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">-f ： force 强制的意思，如果目标文件已经存在，不会询问而直接覆盖</tspan>
        </text>
    </g>
    <g ed:width="136.2" ed:height="38" transform="matrix(1,0,0,1,235.75,1873.02)" ed:parentid="101" id="276">
        <path stroke-width="3" stroke="#ffffff" fill="#eb6d71" stroke-linejoin="round" d="M9.5,0L136.2,0L126.7,38L0,38L9.5,0z"/>
        <text class="st32">
            <tspan style="white-space:pre" y="23.5" x="21">获取文件内容</tspan>
        </text>
    </g>
    <g ed:width="36" ed:height="21" transform="matrix(1,0,0,1,398.95,1744.02)" ed:parentid="276" id="278">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">cat</tspan>
        </text>
    </g>
    <g ed:width="103" ed:height="21" transform="matrix(1,0,0,1,461.95,1744.02)" ed:parentid="278" id="282">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">取得文件内容。</tspan>
        </text>
    </g>
    <g ed:width="50" ed:height="21" transform="matrix(1,0,0,1,398.95,1854.02)" ed:parentid="276" id="284">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">more</tspan>
        </text>
    </g>
    <g ed:width="404" ed:height="21" transform="matrix(1,0,0,1,475.95,1771.52)" ed:parentid="284" id="286">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">和 cat 不同的是它可以一页一页查看文件内容，比较适合大文件的查看。</tspan>
        </text>
    </g>
    <g ed:width="222" ed:height="21" transform="matrix(1,0,0,1,475.95,1799.02)" ed:parentid="284" id="288">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">按Space键：显示文本的下一屏内容。</tspan>
        </text>
    </g>
    <g ed:width="228" ed:height="21" transform="matrix(1,0,0,1,475.95,1826.52)" ed:parentid="284" id="290">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">按Enier键：只显示文本的下一行内容。</tspan>
        </text>
    </g>
    <g ed:width="408" ed:height="21" transform="matrix(1,0,0,1,475.95,1854.02)" ed:parentid="284" id="292">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">按斜线符/：接着输入一个模式，可以在文本中寻找下一个相匹配的模式。</tspan>
        </text>
    </g>
    <g ed:width="280" ed:height="21" transform="matrix(1,0,0,1,475.95,1881.52)" ed:parentid="284" id="294">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">按H键：显示帮助屏，该屏上有相关的帮助信息。</tspan>
        </text>
    </g>
    <g ed:width="159" ed:height="21" transform="matrix(1,0,0,1,475.95,1909.02)" ed:parentid="284" id="296">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">按B键：显示上一屏内容。</tspan>
        </text>
    </g>
    <g ed:width="157" ed:height="21" transform="matrix(1,0,0,1,475.95,1936.52)" ed:parentid="284" id="298">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">按Q键：退出rnore命令。</tspan>
        </text>
    </g>
    <g ed:width="48" ed:height="21" transform="matrix(1,0,0,1,398.95,1991.52)" ed:parentid="276" id="300">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">head</tspan>
        </text>
    </g>
    <g ed:width="115" ed:height="21" transform="matrix(1,0,0,1,473.95,1991.52)" ed:parentid="300" id="302">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">取得文件前几行。</tspan>
        </text>
    </g>
    <g ed:width="36" ed:height="21" transform="matrix(1,0,0,1,398.95,2019.02)" ed:parentid="276" id="304">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">tail</tspan>
        </text>
    </g>
    <g ed:width="248" ed:height="21" transform="matrix(1,0,0,1,461.95,2019.02)" ed:parentid="304" id="306">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">是 head 的反向操作，只是取得是后几行。</tspan>
        </text>
    </g>
    <g ed:width="151.2" ed:height="38" transform="matrix(1,0,0,1,235.75,2169.27)" ed:parentid="101" id="308">
        <path stroke-width="3" stroke="#ffffff" fill="#b296b8" stroke-linejoin="round" d="M9.5,0L151.2,0L141.7,38L0,38L9.5,0z"/>
        <text class="st32">
            <tspan style="white-space:pre" y="23.5" x="21">指令与文件搜索</tspan>
        </text>
    </g>
    <g ed:width="54" ed:height="21" transform="matrix(1,0,0,1,413.95,2100.52)" ed:parentid="308" id="310">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">locate</tspan>
        </text>
    </g>
    <g ed:width="295" ed:height="21" transform="matrix(1,0,0,1,494.95,2073.02)" ed:parentid="310" id="312">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">文件搜索。可以用关键字或者正则表达式进行搜索。</tspan>
        </text>
    </g>
    <g ed:width="144.2" ed:height="38" transform="matrix(1,0,0,1,235.75,429)" ed:parentid="101" id="314">
        <path stroke-width="3" stroke="#ffffff" fill="#3498db" stroke-linejoin="round" d="M9.5,0L144.2,0L134.7,38L0,38L9.5,0z"/>
        <text class="st32">
            <tspan style="white-space:pre" y="23.5" x="21">Linux文件体系</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,406.95,268)" ed:parentid="314" id="316">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">Linux以文件的形式对计算机中的数据和硬件资源进行管理，内核将所有外部设备都可以看做</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">一个文件来操作。那么我们对与外部设备的操作都可以看做对文件进行操作</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,406.95,312.5)" ed:parentid="314" id="318">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">反映在Linux的文件类型上就是：普通文件、目录文件（也就是文件夹）、设备文件、链接文</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">件、管道文件、套接字文件（数据通信的接口）</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,406.95,357)" ed:parentid="314" id="326">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">对一个文件的读写，都通过调用内核提供的系统调用；内核给我们返回一个file </tspan>
            <tspan style="white-space:pre" y="31.5" x="9">descriptor（fd,文件描述符）</tspan>
        </text>
    </g>
    <g ed:width="221" ed:height="21" transform="matrix(1,0,0,1,494.95,2100.52)" ed:parentid="310" id="328">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">搜索 etc 目录下所有以 sh 开头的文件</tspan>
        </text>
    </g>
    <g ed:width="98" ed:height="21" transform="matrix(1,0,0,1,742.95,2100.52)" ed:parentid="328" id="330">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">locate /etc/sh</tspan>
        </text>
    </g>
    <g ed:width="234" ed:height="21" transform="matrix(1,0,0,1,494.95,2128.02)" ed:parentid="310" id="332">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">搜索用户主目录下，所有以m开头的文件</tspan>
        </text>
    </g>
    <g ed:width="83" ed:height="21" transform="matrix(1,0,0,1,755.95,2128.02)" ed:parentid="332" id="334">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">locate ~/m</tspan>
        </text>
    </g>
    <g ed:width="41" ed:height="21" transform="matrix(1,0,0,1,413.95,2155.52)" ed:parentid="308" id="336">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">find</tspan>
        </text>
    </g>
    <g ed:width="150" ed:height="21" transform="matrix(1,0,0,1,481.95,2155.52)" ed:parentid="336" id="338">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">find / -name install.log</tspan>
        </text>
    </g>
    <g ed:width="47" ed:height="21" transform="matrix(1,0,0,1,413.95,2196.77)" ed:parentid="308" id="340">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">grep</tspan>
        </text>
    </g>
    <g ed:width="247" ed:height="21" transform="matrix(1,0,0,1,487.95,2183.02)" ed:parentid="340" id="342">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">翻译为全面搜索正则表达式并把行打印出来</tspan>
        </text>
    </g>
    <g ed:width="475" ed:height="21" transform="matrix(1,0,0,1,487.95,2210.52)" ed:parentid="340" id="344">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">是一种强大的文本搜索工具，它能使用正则表达式搜索文本，并把匹配的行打印出来。</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,413.95,2260.27)" ed:parentid="308" id="346">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">管道</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,483.95,2238.02)" ed:parentid="346" id="348">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">将一个命令的标准输出作为另一个命令的标准输入，在数据需要经过多个步骤的处理之后才能</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">得到我们想要的内容时就可以使用管线。</tspan>
        </text>
    </g>
    <g ed:width="210" ed:height="21" transform="matrix(1,0,0,1,483.95,2282.52)" ed:parentid="346" id="350">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">在命令之间使用 | 分隔各个管线命令</tspan>
        </text>
    </g>
    <g ed:width="166.2" ed:height="38" transform="matrix(1,0,0,1,235.75,2477.09)" ed:parentid="101" id="352">
        <path stroke-width="3" stroke="#ffffff" fill="#96a6a6" stroke-linejoin="round" d="M9.5,0L166.2,0L156.7,38L0,38L9.5,0z"/>
        <text class="st32">
            <tspan style="white-space:pre" y="23.5" x="21">压缩与解压缩命令</tspan>
        </text>
    </g>
    <g ed:width="91" ed:height="21" transform="matrix(1,0,0,1,428.95,2416.84)" ed:parentid="352" id="354">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">常用压缩格式</tspan>
        </text>
    </g>
    <g ed:width="275" ed:height="181.651" transform="matrix(1,0,0,1,546.95,2336.52)" ed:parentid="354" id="356">
        <use width="260" y="0" height="178" transform="translate(9,3.1)" x="0" xlink:href="#image194"/>
    </g>

    <g ed:width="36" ed:height="21" transform="matrix(1,0,0,1,428.95,2620.92)" ed:parentid="352" id="371">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">.gz</tspan>

    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,491.95,2620.92)" ed:parentid="371" id="373">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">压缩</tspan>
        </text>
    </g>
    <g ed:width="309" ed:height="21" transform="matrix(1,0,0,1,561.95,2607.17)" ed:parentid="373" id="375">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">gzip 源文件 压缩为.gz格式的压缩文件，源文件会消失</tspan>
        </text>
    </g>
    <g ed:width="377" ed:height="21" transform="matrix(1,0,0,1,561.95,2634.67)" ed:parentid="373" id="377">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">gzip -c 源文件 > 压缩文件 压缩为.gz格式的压缩文件，源文件保留</tspan>
        </text>
    </g>
    <g ed:width="106.2" ed:height="38" transform="matrix(1,0,0,1,235.75,2743.67)" ed:parentid="101" id="379">
        <path stroke-width="3" stroke="#ffffff" fill="#1bbc9d" stroke-linejoin="round" d="M9.5,0L106.2,0L96.7,38L0,38L9.5,0z"/>
        <text class="st32">
            <tspan style="white-space:pre" y="23.5" x="21">进程管理</tspan>
        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,368.95,2716.17)" ed:parentid="379" id="381">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">查看进程</tspan>
        </text>
    </g>
    <g ed:width="49" ed:height="21" transform="matrix(1,0,0,1,592.95,2688.67)" ed:parentid="385" id="383">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9"> ps -l</tspan>
        </text>
    </g>
    <g ed:width="103" ed:height="21" transform="matrix(1,0,0,1,462.95,2688.67)" ed:parentid="381" id="385">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">查看自己的进程</tspan>
        </text>
    </g>
    <g ed:width="115" ed:height="21" transform="matrix(1,0,0,1,462.95,2716.17)" ed:parentid="381" id="387">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">查看系统所有进程</tspan>
        </text>
    </g>
    <g ed:width="61" ed:height="21" transform="matrix(1,0,0,1,604.95,2716.17)" ed:parentid="387" id="391">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9"> ps aux</tspan>
        </text>
    </g>
    <g ed:width="103" ed:height="21" transform="matrix(1,0,0,1,462.95,2743.67)" ed:parentid="381" id="393">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">查看特定的进程</tspan>
        </text>
    </g>
    <g ed:width="144" ed:height="21" transform="matrix(1,0,0,1,592.95,2743.67)" ed:parentid="393" id="395">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">ps aux | grep threadx</tspan>
        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,368.95,3098)" ed:parentid="420" id="397">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">孤儿进程</tspan>
        </text>
    </g>
    <g ed:width="382" ed:height="21" transform="matrix(1,0,0,1,462.95,3070.5)" ed:parentid="397" id="399">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">父进程先于子进程结束,没办法释放子进程的一些信息就称为孤儿进程</tspan>
        </text>
    </g>
    <g ed:width="488" ed:height="21" transform="matrix(1,0,0,1,462.95,3098)" ed:parentid="397" id="401">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">孤儿进程将被 init 进程（进程号为 1）所收养，并由 init 进程对它们完成状态收集工作。</tspan>
        </text>
    </g>
    <g ed:width="392" ed:height="21" transform="matrix(1,0,0,1,462.95,3125.5)" ed:parentid="397" id="403">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">由于孤儿进程会被 init 进程收养，所以孤儿进程不会对系统造成危害。</tspan>
        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,368.95,3211.25)" ed:parentid="420" id="405">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">僵尸进程</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,462.95,3153)" ed:parentid="405" id="407">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">子进程结束的时候会留下一个数据结构，用这个数据结构存储子进程结束时的信息，直到父进</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">程调用wait或者waitpid的时候才释放。</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,462.95,3197.5)" ed:parentid="405" id="409">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">如果子进程退出，而父进程并没有调用 wait() 或 waitpid()，那么子进程的数据结构仍然保存</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">在系统中，这种进程称之为僵尸进程。</tspan>
        </text>
    </g>
    <g ed:width="323" ed:height="21" transform="matrix(1,0,0,1,462.95,3269.5)" ed:parentid="405" id="411">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">僵尸进程通过 ps 命令显示出来的状态为 Z（zombie）。</tspan>
        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,368.95,2911.84)" ed:parentid="420" id="413">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">进程状态</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,462.95,2911.84)" ed:parentid="413" id="415">

    <g ed:width="106.2" ed:height="38" transform="matrix(1,0,0,1,235.75,3061.09)" ed:parentid="101" id="420">
        <path stroke-width="3" stroke="#ffffff" fill="#3498db" stroke-linejoin="round" d="M9.5,0L106.2,0L96.7,38L0,38L9.5,0z"/>
        <text class="st32">
            <tspan style="white-space:pre" y="23.5" x="21">进程状态</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,368.95,2981.5)" ed:parentid="420" id="422">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">在子进程退出时，它的进程描述符不会立即释放，这是为了让父进程得到子进程信息。父进程</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">通过 wait() 和 waitpid() 来获得一个已经退出的子进程的信息。</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,368.95,3026)" ed:parentid="420" id="424">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">父进程调用 wait() 会一直阻塞，直到收到一个子进程退出的 SIGCHLD 信号，之后 wait() 函</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">数会销毁子进程并返回</tspan>
        </text>
    </g>
    <g ed:width="103" ed:height="21" transform="matrix(1,0,0,1,372.95,3337.25)" ed:parentid="432" id="426">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">启动第一个进程</tspan>
        </text>
    </g>
    <g ed:width="492" ed:height="21" transform="matrix(1,0,0,1,502.95,3323.5)" ed:parentid="426" id="428">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">init进程，系统启动的第一个用户级进程，是所有其它进程的父进程，引导用户空间服务。</tspan>
        </text>
    </g>
    <g ed:width="157" ed:height="21" transform="matrix(1,0,0,1,502.95,3351)" ed:parentid="426" id="430">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">pid为 1 的一定是init进程.</tspan>
        </text>
    </g>
    <g ed:width="110.2" ed:height="38" transform="matrix(1,0,0,1,235.75,4484)" ed:parentid="101" id="432">
        <path stroke-width="3" stroke="#ffffff" fill="#2da2bf" stroke-linejoin="round" d="M9.5,0L110.2,0L100.7,38L0,38L9.5,0z"/>
        <text class="st32">
            <tspan style="white-space:pre" y="23.5" x="21">linux问题</tspan>
        </text>
    </g>
    <g ed:width="188" ed:height="21" transform="matrix(1,0,0,1,372.95,3773.75)" ed:parentid="432" id="583">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">fork()、vfork()、clone()的区别</tspan>
        </text>
    </g>
    <g ed:width="51" ed:height="21" transform="matrix(1,0,0,1,587.95,3662.5)" ed:parentid="583" id="587">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">fork()</tspan>
        </text>
    </g>
    <g ed:width="398" ed:height="21" transform="matrix(1,0,0,1,665.95,3567)" ed:parentid="587" id="589">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">调用成功：返回两个值； 父进程：返回子进程的PID；子进程：返回0；</tspan>
        </text>
    </g>
    <g ed:width="103" ed:height="21" transform="matrix(1,0,0,1,1090.95,3567)" ed:parentid="589" id="591">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">失败：返回-1；</tspan>
        </text>
    </g>
    <g ed:width="111" ed:height="21" transform="matrix(1,0,0,1,372.95,3428.25)" ed:parentid="432" id="593">

        </text>
    </g>
    <g ed:width="127" ed:height="21" transform="matrix(1,0,0,1,510.95,3378.5)" ed:parentid="593" id="595">

            <tspan style="white-space:pre" y="14.4" x="9">有一段程序供其执行</tspan>
        </text>
    </g>
    <g ed:width="163" ed:height="21" transform="matrix(1,0,0,1,510.95,3406)" ed:parentid="593" id="597">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">有自己的专用系统堆栈空间</tspan>
        </text>
    </g>
    <g ed:width="164" ed:height="21" transform="matrix(1,0,0,1,510.95,3433.5)" ed:parentid="593" id="599">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">进程控制块（task_struct）</tspan>
        </text>
    </g>
    <g ed:width="127" ed:height="21" transform="matrix(1,0,0,1,510.95,3469.5)" ed:parentid="593" id="601">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">有独立的存储空间。</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,664.95,3461)" ed:parentid="601" id="603">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">  缺少此条的称为线程，如果完全没有用户空间称为内核线程，共享用户空间的称为用户线</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">程。</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="89" transform="matrix(1,0,0,1,665.95,3594.5)" ed:parentid="587" id="609">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">fork子进程完全复制父进程的栈空间，也复制了页表，但没有复制物理页面，所以这时虚拟地</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">址相同，物理地址也相同，但是会把父子共享的页面标记为“只读”,linux为了提高fork效率,</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">采用copy-on-write技术,这两个虚拟地址指向的是相同物理地址,只要有任何一个进程修改这个</tspan>
            <tspan style="white-space:pre" y="65.5" x="9">虚拟地址内的内容时(或者变量),就会使者两个虚拟地址指向不同的物理地址,复制源物理地址变</tspan>
            <tspan style="white-space:pre" y="82.5" x="9">成新的物理地址之后分配</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,587.95,3514)" ed:parentid="583" id="615">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">exec()系列函数则是用来用指定的程序替换当前进程的所有内容。所以exec()系列函数经常在</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">前三个函数使用之后调用，来创建一个全新的程序运行环境。</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="55" transform="matrix(1,0,0,1,1129.95,3505.5)" ed:parentid="615" id="617">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">根据指定的文件名找到可执行文件，并用它来取代调用进程的内容，主要是在fork()之后，它</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">会诱导fork后的子进程另起炉灶，但是PID不变，自己开创一片新天地，清空原来的堆栈区、</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">代码区和数据区，让新的可执行程序完全替代现有的资源</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="89" transform="matrix(1,0,0,1,665.95,3690)" ed:parentid="587" id="619">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">fork之后内核一般会通过将子进程放在队列的前面，以让子进程先执行，因为很多情况下子进</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">程要马上执行exec，会清空栈、堆，这些和父进程共享的空间，加载新的代码段。。这就避免</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">了父进程“写时复制”拷贝共享页面的机会。如果父进程先调度很可能写共享页面，而子进程</tspan>
            <tspan style="white-space:pre" y="65.5" x="9">什么也没做，会产生“写时复制”的无用功。所以，一般子进程先调度。避免因无意义的复制</tspan>
            <tspan style="white-space:pre" y="82.5" x="9">而造成效率的下降。</tspan>
        </text>
    </g>
    <g ed:width="61" ed:height="21" transform="matrix(1,0,0,1,587.95,3852.25)" ed:parentid="583" id="631">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">vfork() </tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,675.95,3785.5)" ed:parentid="631" id="633">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">一个过时的应用，vfork也是创建一个子进程，但是子进程共享父进程的空间。在vfork创建子</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">进程之后，父进程阻塞，直到子进程执行了exec()或者exit()。有点象线程</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,675.95,3830)" ed:parentid="631" id="635">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9"> vfork创建出来的不是真正意义上的进程，而是一个线程，因为它缺少经常要素（4），独立</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">的内存资源</tspan>
        </text>
    </g>
    <g ed:width="469" ed:height="21" transform="matrix(1,0,0,1,675.95,3874.5)" ed:parentid="631" id="637">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">不像fork会自动新建地址,而是共享父进程的地址和空间,操作变量的话也会改变父进程</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,675.95,3902)" ed:parentid="631" id="639">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">vfork创建的子进程要先于父进程执行，子进程执行时，父进程处于挂起状态，子进程执行</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">完，唤醒父进程。除非子进程exit或者execve才会唤起父进程</tspan>
        </text>
    </g>
    <g ed:width="50" ed:height="21" transform="matrix(1,0,0,1,587.95,3994.25)" ed:parentid="583" id="641">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">clone</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="55" transform="matrix(1,0,0,1,664.95,3946.5)" ed:parentid="641" id="643">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">是Linux为创建线程设计的（虽然也可以用clone创建进程）。所以可以说clone是fork的升级</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">版本，不仅可以创建进程或者线程，还可以指定创建新的命名空间（namespace）、有选择</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">的继承父进程的内存、甚至可以将创建出来的进程变成父进程的兄弟进程等等。</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="55" transform="matrix(1,0,0,1,664.95,4008)" ed:parentid="641" id="645">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">可以让你有选择性的继承父进程的资源，你可以选择想vfork一样和父进程共享一个虚存空</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">间，从而使创造的是线程，你也可以不和父进程共享，你甚至可以选择创造出来的进程和父进</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">程不再是父子关系，而是兄弟关系</tspan>
        </text>
    </g>
    <g ed:width="465" ed:height="21" transform="matrix(1,0,0,1,462.95,3242)" ed:parentid="405" id="647">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">因为数据结构里包含pid等信息，操作系统的pid是有限的，因此僵尸进程是有害的。</tspan>
        </text>
    </g>
    <g ed:width="164.2" ed:height="38" transform="matrix(1,0,0,1,235.75,5828.75)" ed:parentid="101" id="649">
        <path stroke-width="3" stroke="#ffffff" fill="#ee7c31" stroke-linejoin="round" d="M9.5,0L164.2,0L154.7,38L0,38L9.5,0z"/>
        <text class="st32">
            <tspan style="white-space:pre" y="23.5" x="21">iptables基本概念</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,426.95,5715.5)" ed:parentid="649" id="651">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">对linux来说，是能够实现主机防火墙的功能组件，如果部署在网络边缘，那么既可以扮演网络</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">防火墙的角色</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="55" transform="matrix(1,0,0,1,426.95,5760)" ed:parentid="649" id="657">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">对linux而言tcp/ip协议栈是在内核当中，意味着报文的处理是在内核中处理的，也就是说防火</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">墙必须在工作在内核中，防火墙必须在内核中完成tcp/ip报文所流进的位置，用规则去检查，</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">才真正能工作起来</tspan>
        </text>
    </g>
    <g ed:width="409" ed:height="21" transform="matrix(1,0,0,1,426.95,5821.5)" ed:parentid="649" id="659">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">iptables用来衡量tcp/ip报文的属性：源ip、目标ip、源端口、目标端口；</tspan>
        </text>
    </g>
    <g ed:width="337" ed:height="21" transform="matrix(1,0,0,1,426.95,5849)" ed:parentid="649" id="661">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">tcp标志位:   syn、syn+ack、ack、 fin、urg、psh、rst ；</tspan>
        </text>
    </g>
    <g ed:width="113" ed:height="21" transform="matrix(1,0,0,1,426.95,5917.75)" ed:parentid="649" id="663">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">iptables规则功能</tspan>
        </text>
    </g>
    <g ed:width="45" ed:height="21" transform="matrix(1,0,0,1,566.95,5876.5)" ed:parentid="663" id="665">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">filter</tspan>
        </text>
    </g>
    <g ed:width="335" ed:height="21" transform="matrix(1,0,0,1,638.95,5876.5)" ed:parentid="665" id="667">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">负责防火墙功能 过滤本机流入流出的数据包是默认使用的表</tspan>
        </text>
    </g>
    <g ed:width="60" ed:height="21" transform="matrix(1,0,0,1,566.95,5904)" ed:parentid="663" id="669">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">input   </tspan>
        </text>
    </g>
    <g ed:width="142" ed:height="21" transform="matrix(1,0,0,1,653.95,5904)" ed:parentid="669" id="671">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">过滤进入主机的数据包;</tspan>
        </text>
    </g>
    <g ed:width="69" ed:height="21" transform="matrix(1,0,0,1,566.95,5931.5)" ed:parentid="663" id="673">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">forward </tspan>
        </text>
    </g>
    <g ed:width="199" ed:height="21" transform="matrix(1,0,0,1,662.95,5931.5)" ed:parentid="673" id="675">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">发流经主机但不进入本机的数据包</tspan>
        </text>
    </g>
    <g ed:width="69" ed:height="21" transform="matrix(1,0,0,1,566.95,5959)" ed:parentid="663" id="677">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">output   </tspan>
        </text>
    </g>
    <g ed:width="271" ed:height="21" transform="matrix(1,0,0,1,662.95,5959)" ed:parentid="677" id="679">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">处理源地址的数据包，就是对本机发出的数据包</tspan>
        </text>
    </g>
    <g ed:width="185" ed:height="21" transform="matrix(1,0,0,1,372.95,4802)" ed:parentid="432" id="692">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">五种 IO 模型的特点以及比较。</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,584.95,4483.25)" ed:parentid="692" id="694">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">概念</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,654.95,4433.5)" ed:parentid="694" id="696">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">同步</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,654.95,4469.5)" ed:parentid="694" id="698">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">异步</tspan>
        </text>
    </g>
    <g ed:width="44" ed:height="21" transform="matrix(1,0,0,1,654.95,4505.5)" ed:parentid="694" id="700">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">阻塞</tspan>
        </text>
    </g>
    <g ed:width="56" ed:height="21" transform="matrix(1,0,0,1,654.95,4533)" ed:parentid="694" id="702">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">非阻塞</tspan>
        </text>
    </g>
    <g ed:width="350" ed:height="21" transform="matrix(1,0,0,1,724.95,4433.5)" ed:parentid="696" id="704">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">发出调用没得到结果前调用不返回, 一旦调用返回就得到返回值</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,724.95,4461)" ed:parentid="698" id="706">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">方法调用后,调用者直接返回,不会立刻得到结果, 但是调用发出后,被调用者可以通过通知来通知</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">调用者</tspan>
        </text>
    </g>
    <g ed:width="451" ed:height="21" transform="matrix(1,0,0,1,725.95,4505.5)" ed:parentid="700" id="708">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">调用结果返回之前，当前线程会被挂起。调用线程只有在得到结果之后才会返回。</tspan>
        </text>
    </g>
    <g ed:width="295" ed:height="21" transform="matrix(1,0,0,1,737.95,4533)" ed:parentid="702" id="710">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">不能立刻得到结果之前，该调用不会阻塞当前线程。</tspan>
        </text>
    </g>
    <g ed:width="81" ed:height="21" transform="matrix(1,0,0,1,584.95,5047.5)" ed:parentid="692" id="712">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">五种IO模型</tspan>
        </text>
    </g>
    <g ed:width="170" ed:height="21" transform="matrix(1,0,0,1,692.95,4582.75)" ed:parentid="712" id="714">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">1)阻塞I/O（blocking I/O）</tspan>
        </text>
    </g>
    <g ed:width="208" ed:height="21" transform="matrix(1,0,0,1,692.95,4641)" ed:parentid="712" id="716">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">2)非阻塞I/O （nonblocking I/O）</tspan>
        </text>
    </g>
    <g ed:width="160" ed:height="21" transform="matrix(1,0,0,1,692.95,5061.25)" ed:parentid="712" id="718">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">3) I/O复用(select 和poll) </tspan>
        </text>
    </g>
    <g ed:width="268" ed:height="21" transform="matrix(1,0,0,1,692.95,5481.5)" ed:parentid="712" id="720">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">4)信号驱动I/O （signal driven I/O (SIGIO)）</tspan>
        </text>
    </g>
    <g ed:width="353" ed:height="21" transform="matrix(1,0,0,1,692.95,5526)" ed:parentid="712" id="722">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">5)异步I/O （asynchronous I/O (the POSIX aio_functions)）</tspan>
        </text>
    </g>
    <g ed:width="189" ed:height="21" transform="matrix(1,0,0,1,889.95,4560.5)" ed:parentid="714" id="724">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">最常见的I/O模型是阻塞I/O模型</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,889.95,4588)" ed:parentid="714" id="726">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">进程空间中调用recvfrom，其系统调用直到数据报到达且被拷贝到应用进程的缓冲区中或者发</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">生错误才返回，开始到返回这段区间可以说是被阻塞的</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,927.95,4632.5)" ed:parentid="716" id="728">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">当请求的IO无法完成时,不进行睡眠而是不断测试数据是否已经准备好进行IO操作,会占用大量</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">CPU时间</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="55" transform="matrix(1,0,0,1,879.95,4704.5)" ed:parentid="718" id="730">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">linux提供select/poll，进程通过将一个或多个fd传递给select或poll系统调用，阻塞在select;</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">这样select/poll可以帮我们侦测许多fd是否就绪。但是select/poll是顺序扫描fd是否就绪，而</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">且支持的fd数量有限</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,987.95,5473)" ed:parentid="720" id="732">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">允许套接口进行信号驱动I/O,并安装一个信号处理函数，进程继续运行并不阻塞。当数据准备</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">好时，进程会收到一个SIGIO信号，可以在信号处理函数中调用I/O操作函数处理数据。</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,1072.95,5517.5)" ed:parentid="722" id="734">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">当一个异步过程调用发出后，调用者不能立刻得到结果。实际处理这个调用的部件在完成后，</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">通过状态、通知和回调来通知调用者的输入输出操作</tspan>
        </text>
    </g>
    <g ed:width="52" ed:height="21" transform="matrix(1,0,0,1,879.95,4915.25)" ed:parentid="718" id="736">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">select</tspan>
        </text>
    </g>
    <g ed:width="268" ed:height="21" transform="matrix(1,0,0,1,1028.95,4992.5)" ed:parentid="772" id="746">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">每次调用select需要在内核遍历 所有的fd, O(n)</tspan>
        </text>
    </g>
    <g ed:width="41" ed:height="21" transform="matrix(1,0,0,1,879.95,5047.5)" ed:parentid="718" id="748">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">poll</tspan>
        </text>
    </g>
    <g ed:width="335" ed:height="21" transform="matrix(1,0,0,1,947.95,5047.5)" ed:parentid="748" id="750">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">和select类似 只是fd集合是用链表来存储,没有最大数量限制</tspan>
        </text>
    </g>
    <g ed:width="48" ed:height="21" transform="matrix(1,0,0,1,879.95,5232.75)" ed:parentid="718" id="754">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">epoll</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,954.95,5346)" ed:parentid="754" id="764">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">优点</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,1024.95,5301.5)" ed:parentid="764" id="766">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">没有最大并发连接的限制，能打开的FD的上限远大于1024（1G的内存上能监听约10万个端</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">口）</tspan>
        </text>
    </g>
    <g ed:width="358" ed:height="21" transform="matrix(1,0,0,1,1024.95,5346)" ed:parentid="764" id="768">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">效率提升，不是轮询的方式，不会随着FD数目的增加效率下降。</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,1024.95,5373.5)" ed:parentid="764" id="770">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">内存拷贝，利用mmap()文件映射内存加速与内核空间的消息传递；即epoll使用mmap减少复</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">制开销。</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,958.95,4992.5)" ed:parentid="736" id="772">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">缺点</tspan>
        </text>
    </g>
    <g ed:width="422" ed:height="21" transform="matrix(1,0,0,1,1028.95,5020)" ed:parentid="772" id="774">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">select支持的文件描述符有大小限制，它由FD_SETSIZE设置，默认值是1024</tspan>
        </text>
    </g>
    <g ed:width="91" ed:height="21" transform="matrix(1,0,0,1,662.95,911)" ed:parentid="188" id="827">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">类似快捷方式</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,544.95,866.5)" ed:parentid="186" id="829">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">建立软链接就是建立了一个链接文件。系统就会发现他是个链接文件，它读取链接文件找到真</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">正要访问的文件</tspan>
        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,368.95,2793.42)" ed:parentid="379" id="816">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">杀掉进程</tspan>
        </text>
    </g>
    <g ed:width="79" ed:height="38" transform="matrix(1,0,0,1,462.95,2771.17)" ed:parentid="816" id="818">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">kill PID</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">杀掉某进程</tspan>
        </text>
    </g>
    <g ed:width="443" ed:height="21" transform="matrix(1,0,0,1,462.95,2815.67)" ed:parentid="816" id="820">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">kill - 9 表示强制杀死该进程；而 kill 则有局限性，例如后台进程，守护进程等；</tspan>
        </text>
    </g>
    <g ed:width="188" ed:height="21" transform="matrix(1,0,0,1,372.95,5611.75)" ed:parentid="432" id="809">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">关于linux下的.a文件与 .so 文件</tspan>
        </text>
    </g>
    <g ed:width="199" ed:height="21" transform="matrix(1,0,0,1,587.95,5562)" ed:parentid="809" id="811">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">其实就是静态链接库与动态链接库</tspan>
        </text>
    </g>
    <g ed:width="353" ed:height="21" transform="matrix(1,0,0,1,587.95,5589.5)" ed:parentid="809" id="813">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">静态链接就是编译的时候将所需的函数库和本身绑定在一起   .a</tspan>
        </text>
    </g>
    <g ed:width="258" ed:height="21" transform="matrix(1,0,0,1,587.95,5639.25)" ed:parentid="809" id="815">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">动态链接库 , 将库函数推迟到运行期间再载入</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,872.95,5639.25)" ed:parentid="815" id="823">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">好处</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,942.95,5617)" ed:parentid="823" id="831">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">程序运行过程发现需要某个链接库的时候, 操作系统就会查看内存是否已经有该库函数,如果没</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">有就得连接,  虽然带来开销但是节省内存资源</tspan>
        </text>
    </g>
    <g ed:width="286" ed:height="21" transform="matrix(1,0,0,1,942.95,5661.5)" ed:parentid="823" id="833">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">程序升级只需要升级动态链接库即可,不用重新编译</tspan>
        </text>
    </g>
    <g ed:width="72" ed:height="21" transform="matrix(1,0,0,1,692.95,4188)" ed:parentid="849" id="837">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">Linux环境</tspan>
        </text>
    </g>
    <g ed:width="312" ed:height="21" transform="matrix(1,0,0,1,791.95,4188)" ed:parentid="837" id="839">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">Linux的内核将所有外部设备都可以看做一个文件来操作</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,1130.95,4069.5)" ed:parentid="839" id="841">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">对外部设备操作其实就是文件操作, 对文件读写是通过内核提供系统调用,        内核返回文件</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">描述符fd</tspan>
        </text>
    </g>
    <g ed:width="413" ed:height="21" transform="matrix(1,0,0,1,1130.95,4114)" ed:parentid="839" id="843">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">对一个socket的读写也会有相应的描述符，称为socketfd(socket描述符）</tspan>
        </text>
    </g>
    <g ed:width="418" ed:height="21" transform="matrix(1,0,0,1,1130.95,4141.5)" ed:parentid="839" id="845">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">描述符可以理解为 指向文件的索引,  对文件读写就是通过描述符读写完成的</tspan>
        </text>
    </g>
    <g ed:width="283" ed:height="21" transform="matrix(1,0,0,1,1130.95,4237.75)" ed:parentid="839" id="847">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">应用程序对文件的读写就通过对描述符的读写完成</tspan>
        </text>
    </g>
    <g ed:width="81" ed:height="21" transform="matrix(1,0,0,1,584.95,4237.75)" ed:parentid="692" id="849">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">IO基本概念</tspan>
        </text>
    </g>
    <g ed:width="201" ed:height="21" transform="matrix(1,0,0,1,1440.95,4237.75)" ed:parentid="847" id="851">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">一个基本的IO，涉及两个系统对象</tspan>
        </text>
    </g>
    <g ed:width="177" ed:height="21" transform="matrix(1,0,0,1,1668.95,4169)" ed:parentid="851" id="853">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">一个是调用这个IO的进程对象</tspan>
        </text>
    </g>
    <g ed:width="171" ed:height="21" transform="matrix(1,0,0,1,1668.95,4196.5)" ed:parentid="851" id="855">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">另一个就是系统内核(kernel)</tspan>
        </text>
    </g>
    <g ed:width="226" ed:height="21" transform="matrix(1,0,0,1,1668.95,4224)" ed:parentid="851" id="857">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">通过read系统调用想内核发起读请求。</tspan>
        </text>
    </g>
    <g ed:width="235" ed:height="21" transform="matrix(1,0,0,1,1668.95,4251.5)" ed:parentid="851" id="859">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">内核向硬件发送读指令，并等待读就绪。</tspan>
        </text>
    </g>
    <g ed:width="343" ed:height="21" transform="matrix(1,0,0,1,1668.95,4279)" ed:parentid="851" id="861">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">内核把将要读取的数据复制到描述符所指向的内核缓存区中。</tspan>
        </text>
    </g>
    <g ed:width="259" ed:height="21" transform="matrix(1,0,0,1,1668.95,4306.5)" ed:parentid="851" id="863">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">将数据从内核缓存区拷贝到用户进程空间中。</tspan>
        </text>
    </g>
    <g ed:width="151" ed:height="21" transform="matrix(1,0,0,1,1105.95,4560.5)" ed:parentid="724" id="865">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">所有文件操作都是阻塞的</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,879.95,4766)" ed:parentid="718" id="867">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">select，poll，epoll本质上都是同步I/O，因为他们都需要在读写事件就绪后自己负责进行读</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">写，也就是说这个读写过程是阻塞的</tspan>
        </text>
    </g>
    <g ed:width="376" ed:height="21" transform="matrix(1,0,0,1,692.95,4334)" ed:parentid="849" id="878">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">Linux一切皆文件, 文件就是二进制流, 我们对流操作其实就是IO操作</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,692.95,4361.5)" ed:parentid="849" id="880">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">系统中的流是根据文件描述符fd来识别的, fd是一个整数,对这个整数操作就是对这个文件流操</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">作</tspan>
        </text>
    </g>
    <g ed:width="428" ed:height="21" transform="matrix(1,0,0,1,692.95,4406)" ed:parentid="849" id="882">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">创建一个socket 系统就会返回一个文件描述符, 之后转变为对这个描述符操作</tspan>
        </text>
    </g>
    <g ed:width="458" ed:height="21" transform="matrix(1,0,0,1,879.95,4677)" ed:parentid="718" id="884">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">I/O复用模型能够同时阻塞多个I/O操作,同时监听多个socket，所以才叫做多路复用</tspan>
        </text>
    </g>
    <g ed:width="220" ed:height="21" transform="matrix(1,0,0,1,958.95,4810.5)" ed:parentid="736" id="886">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">用户空间拷贝 fd的set集合到内核空间</tspan>
        </text>
    </g>
    <g ed:width="395" ed:height="21" transform="matrix(1,0,0,1,1028.95,4965)" ed:parentid="772" id="888">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">每次调用select需要将fd集合从用户态拷贝到内核态, fd很多时候开销大</tspan>
        </text>
    </g>
    <g ed:width="427" ed:height="21" transform="matrix(1,0,0,1,954.95,5075)" ed:parentid="754" id="894">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">epoll是事件驱动而不是轮询, 流准备好后 就通知我们进行执行操作, O(1)操作</tspan>
        </text>
    </g>
    <g ed:width="141" ed:height="21" transform="matrix(1,0,0,1,958.95,4838)" ed:parentid="736" id="896">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">注册回调函数_pollwait</tspan>
        </text>
    </g>
    <g ed:width="212" ed:height="21" transform="matrix(1,0,0,1,958.95,4865.5)" ed:parentid="736" id="898">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">遍历所有的fd,调用其对应的poll方法</tspan>
        </text>
    </g>
    <g ed:width="457" ed:height="21" transform="matrix(1,0,0,1,1126.95,4838)" ed:parentid="896" id="900">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">主要工作是 将当前进程 挂到相应的等待队列, 当流就绪,就会唤醒等待队列上的进程</tspan>
        </text>
    </g>
    <g ed:width="257" ed:height="21" transform="matrix(1,0,0,1,958.95,4937.5)" ed:parentid="736" id="904">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">之后将fd_set集合从内核空间拷贝到用户空间</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,958.95,4893)" ed:parentid="736" id="906">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">设备准备就绪就会唤醒等待队列的进程 , 否则超过一段时间没有唤醒的话, 调用select的进程会</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">重新唤醒 获得cpu,进而重新遍历fd</tspan>
        </text>
    </g>
    <g ed:width="115" ed:height="21" transform="matrix(1,0,0,1,954.95,5130)" ed:parentid="754" id="908">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">epoll提供3个函数</tspan>
        </text>
    </g>
    <g ed:width="89" ed:height="21" transform="matrix(1,0,0,1,1096.95,5102.5)" ed:parentid="908" id="910">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">epoll_create</tspan>
        </text>
    </g>
    <g ed:width="120" ed:height="21" transform="matrix(1,0,0,1,1212.95,5102.5)" ed:parentid="910" id="912">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">创建一个epoll句柄</tspan>
        </text>
    </g>
    <g ed:width="66" ed:height="21" transform="matrix(1,0,0,1,1096.95,5130)" ed:parentid="908" id="914">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">epoll_ctl</tspan>
        </text>
    </g>
    <g ed:width="139" ed:height="21" transform="matrix(1,0,0,1,1189.95,5130)" ed:parentid="914" id="916">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">注册要监听的事件类型</tspan>
        </text>
    </g>
    <g ed:width="76" ed:height="21" transform="matrix(1,0,0,1,1096.95,5157.5)" ed:parentid="908" id="918">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">epoll_wait</tspan>
        </text>
    </g>
    <g ed:width="103" ed:height="21" transform="matrix(1,0,0,1,1199.95,5157.5)" ed:parentid="918" id="920">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">等待事件的产生</tspan>
        </text>
    </g>
    <g ed:width="453" ed:height="21" transform="matrix(1,0,0,1,954.95,5185)" ed:parentid="754" id="922">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">每次注册新时间到expoll句柄时 会把所有的fd拷贝到内核,  保证每个fd只拷贝一次</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="55" transform="matrix(1,0,0,1,954.95,5212.5)" ed:parentid="754" id="924">
        <text class="st33">
            <tspan style="white-space:pre" y="14.5" x="9">不像select., 每次将进程加入到对应的等待队列,  而是在epoll_ctl时把进程挂一遍并为每个fd</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">指定一个回调函数, 当设备就绪,就会调用这个回调函数,而这个回调函数会把就绪fd加入一个就</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">绪链表里</tspan>
        </text>
    </g>
    <g ed:width="292" ed:height="21" transform="matrix(1,0,0,1,954.95,5274)" ed:parentid="754" id="926">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">epoll_wait实际就是在等待链表中查看是否有就绪fd</tspan>
        </text>
    </g>
    <g ed:width="79" ed:height="21" transform="matrix(1,0,0,1,879.95,5431.75)" ed:parentid="718" id="928">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">三者优缺点</tspan>
        </text>
    </g>
    <g ed:width="514" ed:height="21" transform="matrix(1,0,0,1,985.95,5418)" ed:parentid="928" id="930">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">select/poll 需要自己不断轮询fd集合,虽然epoll也需要不断轮询,但是只需要轮询就绪链表即可</tspan>
        </text>
    </g>
    <g ed:width="435" ed:height="21" transform="matrix(1,0,0,1,985.95,5445.5)" ed:parentid="928" id="932">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">select/poll每次调用都要把fd集合从用户态拷贝到内核态,epoll只需要拷贝一次</tspan>
        </text>
    </g>
    <g ed:width="41" ed:height="21" transform="matrix(1,0,0,1,398.95,1964.02)" ed:parentid="276" id="934">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">less</tspan>
        </text>
    </g>
    <g ed:width="214" ed:height="21" transform="matrix(1,0,0,1,466.95,1964.02)" ed:parentid="934" id="936">
        <text class="st33">
            <tspan style="white-space:pre" y="14.4" x="9">和more差不多 不过可以 上下键翻页</tspan>
        </text>
    </g>
